import React from "react";

class Card extends ReatComponent {
    render() {
        return(
            <div className="card">
                <img src={this.props.img}></img>
                <h3>{this.props.title}</h3>
                <p>{this.props.description}</p>
            </div>
        );
    }
}

export default Card;
